package com.ingrid.showdofilmao.repositories;

import com.ingrid.showdofilmao.model.Movie;

import java.util.ArrayList;
import java.util.List;

public class MoviesRepository {

    public void fetchMovies(FecthMoviesCallback fecthMoviesCallback) {
        try {
            Thread.sleep(3000);
        } catch (InterruptedException e) {
            e.printStackTrace();
        }

        List<Movie> movies = mockMovies();

        fecthMoviesCallback.onMoviesFecthed(movies);
    }

    private List<Movie> mockMovies() {
        List<Movie> movies = new ArrayList<>();
        movies.add(new Movie("Mulan", "action", 2020, "data:image/jpeg;base64,"));
        movies.add(new Movie("Sonic", "action", 2019, "data:image/jpeg;base64,"));
        movies.add(new Movie("Homem-Aranha: Longe de casa", "action", 2018, "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSn2kPMl7DQLNvIu9htcpk4cOoxpcqJw6D95NMfEIFWbfflBJkgHD2gjvaPTQ&s=10"));
        movies.add(new Movie("Parasita", "drama", 2019, "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR4nSJI3JzBYn9HxsaEMN9zUVt9YCsRQd546rcm0l2bMbt0v-tUq1zCceZFIA&s=10"));
        movies.add(new Movie("Jumanji", "action", 2019, "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSSXFvyVWJYZ1ulfge7l416qi_n1ugeRUr9VvQwDIXHf_bHYqSAF0cjBeD47Q&s=10"));
        movies.add(new Movie("VIVA: a vida é uma festa", "drama", 2018, "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSeNJcXPu212BA9-sIYswAOFJDK-P5OGUffqvlU97UasTyjI7Ui8KFNA2tp9w&s=10"));

        return movies;
    }
}
